import React from 'react';
import ReactDOM from "react-dom";
//import "./index.css"
const f ="yes we can";
const heading={
    color: "#fa9191",
    textTransform:"capitalize" ,
    textAlign:"center"

};

const m ="https://picsum.photos/400/300";
const n ="https://picsum.photos/400/500";
const b ="https://picsum.photos/200/450";  

ReactDOM.render(
<>
<h1 style={{ color: "#fa9191",textTransform:"capitalize",textAlign:"center" 
}} >this is a page of react</h1>
<div className="imgg">
<img src={m} alt="notshowm" />
<img src={n} alt="notshowm" />
<a href="https://en.wikipedia.org/wiki/Dark_(TV_series)">
<img src={b} alt="notshowm" />
</a>
</div>
<h1 className="yes">jhbl</h1>
<p>{`i am ${f} `}</p>
</>,
document.getElementById("root")
);
